import Layout from '../Components/Layout.js';
import axios from 'axios'

axios.defaults.baseURL = process.env.API_URL
function MyApp({ Component, pageProps }){
    return (
        <Layout>
            <Component {...pageProps} />
        </Layout>
    )
}





export default MyApp
